# Centering a Div in CSS

There are several methods to center a div:

## 1. Flexbox (Recommended)
```css
.parent {
  display: flex;
  justify-content: center;
  align-items: center;
}
```

## 2. Grid
```css
.parent {
  display: grid;
  place-items: center;
}
```

## 3. Absolute Positioning
```css
.child {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
}
```

## 4. Margin Auto (horizontal only)
```css
.child {
  margin: 0 auto;
  width: 50%;
}
```

**Best Practice:** Use Flexbox or Grid for most cases - they're modern, flexible, and well-supported.
